@juteartisans1 wanted to turn handcrafted jute into a source of livelihood for women entrepreneurs, local artisans and communities. To make this happen, she left her corporate career and built a business that now supports 5,500+ women across Lucknow, Barabanki, and Ayodhya. By expanding her business, artisans now have financial independence, support for their children’s education, and access to health benefits.

With Flipkart Samarth’s support, the business scaled nationwide, growing its business by 4x and producing 7 lakh+ jute bags annually that are reaching homes across India.

Her handcrafted products are now reaching Europe and Japan, creating new opportunities for artisans while keeping tradition alive in global markets.

@Flipkart continues to support businesses that bridge tradition and digital commerce, helping artisans access sustainable growth in the evolving retail landscape.

#FlipkartSamarth #WomenLedBusiness #SustainableGrowth #EmpoweringArtisans #VoicesOfIndia

