HAPPY BIRTHDAY! Chris Rea (singer, songwriter) (74)

Chris Rea is an English singer-songwriter and guitarist renowned for his distinctive husky voice and a career that spans over four decades. Born on March 4, 1951, in Middlesbrough, England, Rea rose to prominence in the late 1970s with his hit single "Fool (If You Think It’s Over)," which showcased his knack for blending soulful melodies with introspective lyrics. His music often fuses rock, blues, and pop influences, with standout albums like The Road to Hell (1989) cementing his reputation for crafting atmospheric, storytelling songs. Perhaps his most universally recognized work is the holiday classic "Driving Home for Christmas," a perennial favorite that captures his ability to evoke warmth and nostalgia. Despite facing health challenges, including a pancreatic cancer diagnosis in the early 2000s, Rea has remained a resilient figure in music, continuing to create and perform with a signature style that resonates with fans worldwide.

@chrisreamusic

